import './portfolio.css';
import git from './image/git.svg';
import github from './image/github.svg';
import docker from './image/docker.svg';
import aws from './image/aws.svg';
import css from './image/css.svg';
import express from './image/expressjs.svg';
import graphql from './image/graphql.svg';
import html from './image/html.svg';
import mongodb from './image/mongodb.svg';
import node from './image/nodejs.svg';
import postgresql from './image/postgresql.svg';
import profilePic from './image/profile-pic.png';
import react from './image/reactjs.svg';
import typescript from './image/typescript.svg';
import webpack from './image/webpack.svg';
import verLine from './image/line-v.svg';
import horLine from './image/line-h.svg';
// import React, { useState, useEffect } from 'react';
// import { Route, Routes, Navigate } from 'react-router-dom';
// import HeaderBar from './components/HeaderBar';
// import AboutMe from './components/AboutMe';
// import Projects from './components/Projects';
// import Contact from './components/Contact';

export const Portfolio = () => {
  return (

    <div className='portfolio-p-wrapper'>
      <div className='portfolio-p'>
        <div className='portfolio-overlap'>
          <div className='portfolio-frame' />
          <h1 className='portfolio-name'>RHEA WU</h1>
        </div>
        <div className='portfolio-overlap-group'>
          <img className='portfolio-stack-gh' src={github} />
          <div className='portfolio-overlap-group12'>
            <div className='portfolio-overlap-group11'>
              <div className='portfolio-overlap-group10'>
                <img className='portfolio-stack-git' src={git} />
                <img className='portfolio-stack-docker' src={docker} />
              </div>
              <div className='portfolio-overlap-group7'>
                <img className-='portfolio-aws' src={aws} />
                <img className='portfolio-webpack' src={webpack} />
                <img className='portfolio-graphql' src={graphql} />
                <img className='portfolio-express' src={express} />
                <img className='portfolio-mongodb' src={mongodb} />
                <img className='portfolio-line-v' src={verLine} />
              </div>
            </div>
            <div className='portfolio-overlap-group9'>
              <img className='portfolio-html' src={html} />
              <img className='portfolio-css' src={css} />
              <img className='portfolio-node' src={node} />
            </div>
            <img className='portfolio-postgresql' src={postgresql} />
            <img className='portfolio-typescript' src={typescript} />
            <div className='portfolio-overlap-group8'>
              <img className='portfolio-line-v' src={verLine} />
              <a href='https://github.com/quittersarewinners/Quitr' target></a>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}
